import React from 'react';
import styled from 'styled-components';

function ProfileAside(props) {
	return (
		<ComponentWrapper>
			<aside className="Aside Aside_className__1dlg0">
				<header className="Aside-header">
					<div className="Aside-avatar">
						<div
							className="Aside-avatar_image"
							style={{
								backgroundImage: `url("https://k.kakaocdn.net/dn/cHUADA/btrvJZxMkUJ/5zLQF5ttsOh1ffK7MPThw1/img_110x110.jpg"), url("https://static.wanted.co.kr/images/profile_default.png")`,
							}}
						>
							<div className="AvatarCrop_className__QpMGf">
								<input type="file" accept="image/*" />
								<i
									className="icon-camera_icon"
									role="presentation"
								/>
							</div>
						</div>
					</div>
					<div className="Aside-me">
						<div className="Aside-me_name">이해찬</div>
						<div className="Aside-me_email">bun0373@gmail.com</div>
						<div className="Aside-me_tel">010-2697-2321</div>
					</div>
					<a
						href="/profile/matching?level=1"
						className="Aside-edit"
						aria-label=""
						data-attribute-id="profile__basicInfoEdit"
					>
						기본정보 수정
					</a>
				</header>
				<div className="MatchUpStatus MatchUpStatus_className__xnS2O">
					<a
						href="/profile/status?type=matchup-likes"
						className="MatchUpStatus-item"
						aria-label=""
					>
						<span className="MatchUpStatus-label">관심 있음</span>
						<strong className="MatchUpStatus-value">0</strong>
					</a>
					<a
						href="/profile/status?type=matchup-opens"
						className="MatchUpStatus-item"
						aria-label=""
					>
						<span className="MatchUpStatus-label">열람</span>
						<strong className="MatchUpStatus-value">0</strong>
					</a>
					<a
						href="/profile/status?type=matchup-offers"
						className="MatchUpStatus-item"
						aria-label=""
					>
						<span className="MatchUpStatus-label">받은 제안</span>
						<strong className="MatchUpStatus-value">0</strong>
					</a>
				</div>
			</aside>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.aside`
	top: 0;
	left: 0;
	width: 250px;
	position: absolute;
	padding: 42px 20px 41px;
	border: 1px solid #e1e2e3;
	border-radius: 3px;
	background-color: #fff;
	margin-bottom: 0;
	.Aside-header {
		width: 100%;
		text-align: center;
	}
	.Aside-avatar {
		line-height: 1.4;
	}
	.Aside-avatar_image {
		display: inline-block;
		position: relative;
		width: 77px;
		height: 77px;
		border-radius: 50%;
		background-size: cover;
		background-position: 50%;
	}
	.Aside-me {
		margin-top: 31px;
		font-size: 14px;
		font-weight: 500;
		line-height: 1.07;
		color: #999;
	}
`;
export default ProfileAside;
